n = database.getCollection(&quot;classes&quot;);</code> <code>collection.aggregate( &lt;lookup code here&gt;);&#47;&#47; example of how to do $lookup:{....}</code>"},{"owner":{"reputation":357,"user_id":15148356,"user_type":"registered","profile_image":"https://www.gravatar.com/avatar/ce12ac5fae87778effdb31a2551b205e?s=128&d=identicon&r=PG&f=1","display_name":"Erik","link":"https://stackoverflow.com/users/15148356/erik"},"edited":false,"score":0,"creation_date":1614390542,"post_id":66393773,"comment_id":117379174,"content_license":"CC BY-SA 4.0","body":"A little more clarification would be helpful. Do you want to read the collections from mongo, but join them in java.  Or do you want mongo to do the join, and read the result into your java program?"},{"owner":{"reputation":287218,"user_id":207421,"user_type":"registered","accept_rate":82,"profile_image":"https://www.gravatar.com/avatar/5cfe5f7d64f44be04f147295f5c7b88e?s=128&d=identicon&r=PG","display_name":"user207421","link":"https://stackoverflow.com/users/207421/user207421"},"edited":false,"score":0,"creation_date":1614386083,"post_id":66393780,"comment_id":117378460,"content_license":"CC BY-SA 4.0","body":"<code>File</code> variables don&#39;t have content. They are just placeholders for filenames. Resources are not files. Your question doesn&#39;t make sense."},{"owner":{"reputation":425,"user_id":10634487,"user_type":"registered","profile_image":"https://graph.facebook.com/2092877877431329/picture?type=large","display_name":"Bill Naylor","link":"https://stackoverflow.com/users/10634487/bill-naylor"},"edited":false,"score":0,"creation_date":1614381006,"post_id":66393654,"comment_id":117377565,"content_license":"CC BY-SA 4.0","body":"Seems to me that the issue you are seeing is due to the first execution of your <code>squares()</code> method, <code>println</code> is being used, this appends a newline to your output. Following this, you are using <code>print(&quot;    &quot;)</code> which will put 4 spaces (in my case) before the next output.  ...  The important point here is that println is putting the newline at the end of the output, not the beginning, print outputs no newline."},{"owner":{"reputation":132526,"user_id":5221149,"user_type":"registered","profile_image":"https://i.stack.imgur.com/s4qlq.png?s=128&g=1","display_name":"Andreas","link":"https://stackoverflow.com/users/5221149/andreas"},"edited":false,"score":0,"creation_date":1614380877,"post_id":66393780,"comment_id":117377541,"content_license":"CC BY-SA 4.0","body":"<i>FYI:</i> If the application gets deployed as a Jar file, the resource file will not be a file on the file system, which means that what you&#39;re trying to do won&#39;t work. Don&#39;t use <code>File</code> to access resources. To read a resource, use <code>InputStream in = Main.class.getResourceAsStream(&quot;&#47;res&#47;sheet.xlsx&quot;)</code>"},{"owner":{"reputation":132526,"user_id":5221149,"user_type":"registered","profile_image":"https://i.stack.imgur.com/s4qlq.png?s=128&g=1","display_name":"Andreas","link":"https://stackoverflow.com/users/5221149/andreas"},"edited":false,"score":0,"creation_date":1614380778,"post_id":66393780,"comment_id":117377521,"content_license":"CC BY-SA 4.0","body":"It says that class <code>File</code> doesn&#39;t have a <code>File(URL)</code> constructor, which is correct. See the <b>documentation</b>, i.e. the javadoc of <a href=\"https://docs.oracle.com/javase/8/docs/api/java/io/File.html#constructor.summary\" rel=\"nofollow noreferrer\"><code>File</code></a>."},{"owner":{"reputation":13,"user_id":14910097,"user_type":"registered","profile_image":"https://graph.facebook.com/2194024310725096/picture?type=large","display_name":"Josh Voytek","link":"https://stackoverflow.com/users/14910097/josh-voytek"},"edited":false,"score":0,"creation_date":1614380625,"post_id":66393696,"comment_id":117377489,"content_license":"CC BY-SA 4.0","body":"Got it. So selection sort is useless lol. I am going to look into it now, because I do not know why someone would want to use it. Thanks for the feedback!"},{"owner":{"reputation":27889,"user_id":12299000,"user_type":"registered","profile_image":"https://i.stack.imgur.com/0pja9.png?s=128&g=1","display_name":"kaya3","link":"https://stackoverflow.com/users/12299000/kaya3"},"edited":false,"score":0,"creation_date":1614380504,"post_id":66393696,"comment_id":117377457,"content_license":"CC BY-SA 4.0","body":"It would not be selection sort."},{"owner":{"reputation":13,"user_id":14910097,"user_type":"registered","profile_image":"https://graph.facebook.com/2194024310725096/picture?type=large","display_name":"Josh Voytek","link":"https://stackoverflow.com/users/14910097/josh-voytek"},"edited":false,"score":0,"creation_date":1614380434,"post_id":66393696,"comment_id":117377444,"content_license":"CC BY-SA 4.0","body":"So essentially this implementation is just harder to read and has no viable improvement is what I&#39;m hearing here. Is it a bad assumption to assume there will never be an implementation of selection sort that will be &lt; n^2?"},{"owner":{"reputation":45346,"user_id":3890632,"user_type":"registered","profile_image":"https://i.stack.imgur.com/hNkgF.png?s=128&g=1","display_name":"khelwood","link":"https://stackoverflow.com/users/3890632/khelwood"},"edited":false,"score":0,"creation_date":1614380245,"post_id":66393696,"comment_id":117377403,"content_license":"CC BY-SA 4.0","body":"How about you count the number of times your loop actually iterates and see if it behaves like O(n) ?"},{"owner":{"reputation":27889,"user_id":12299000,"user_type":"registered","profile_image":"https://i.stack.imgur.com/0pja9.png?s=128&g=1","display_name":"kaya3","link":"https://stackoverflow.com/users/12299000/kaya3"},"edited":false,"score":5,"creation_date":1614380172,"post_id":66393696,"comment_id":117377386,"content_license":"CC BY-SA 4.0","body":"You appear to be under the misconception that an algorithm with one loop must be O(n). This is not true; your loop iterates O(n^2) times."},{"owner":{"reputation":45346,"user_id":3890632,"user_type":"registered","profile_image":"https://i.stack.imgur.com/hNkgF.png?s=128&g=1","display_name":"khelwood","link":"https://stackoverflow.com/users/3890632/khelwood"},"edited":false,"score":0,"creation_date":1614380153,"post_id":66393696,"comment_id":117377381,"content_license":"CC BY-SA 4.0","body":"You alter the loop variable <code>idx</code> inside the body of the loop, so the loop you do have is not N iterations long."},{"owner":{"reputation":13,"user_id":14910097,"user_type":"registered","profile_image":"https://graph.facebook.com/2194024310725096/picture?type=large","display_name":"Josh Voytek","link":"https://stackoverflow.com/users/14910097/josh-voytek"},"reply_to_user":{"reputation":45346,"user_id":3890632,"user_type":"registered","profile_image":"https://i.stack.imgur.com/hNkgF.png?s=128&g=1","display_name":"khelwood","link":"https://stackoverflow.com/users/3890632/khelwood"},"edited":false,"score":0,"creation_date":1614380043,"post_id":66393696,"comment_id":117377356,"content_license":"CC BY-SA 4.0","body":"So i am trying to grasp why this would still be a O(n^2), if it is just one loop"},{"owner":{"reputation":13,"user_id":14910097,"user_type":"registered","profile_image":"https://graph.facebook.com/2194024310725096/picture?type=large","display_name":"Josh Voytek","link":"https://stackoverflow.com/users/14910097/josh-voytek"},"reply_to_user":{"reputation":45346,"user_id":3890632,"user_type":"registered","profile_image":"https://i.stack.imgur.com/hNkgF.png?s=128&g=1","display_name":"khelwood","link":"https://stackoverflow.com/users/3890632/khelwood"},"edited":false,"score":0,"creation_date":1614380021,"post_id":66393696,"comment_id":117377350,"content_license":"CC BY-SA 4.0","body":"forgoing the typical 2nd for loop"},{"owner":{"reputation":45346,"user_id":3890632,"user_type":"registered","profile_image":"https://i.stack.imgur.com/hNkgF.png?s=128&g=1","display_name":"khelwood","link":"https://stackoverflow.com/users/3890632/khelwood"},"edited":false,"score":0,"creation_date":1614379818,"post_id":66393696,"comment_id":117377313,"content_license":"CC BY-SA 4.0","body":"What makes you think it might be an improvement? What change have you made from a regular selection sort?"},{"owner":{"reputation":4977,"user_id":11002,"user_type":"registered","accept_rate":75,"profile_image":"https://www.gravatar.com/avatar/e442a53d36f9351aee11b5ecb8369691?s=128&d=identicon&r=PG","display_name":"tgdavies","link":"https://stackoverflow.com/users/11002/tgdavies"},"edited":false,"score":1,"creation_date":1614379585,"post_id":66393689,"comment_id":117377255,"content_license":"CC BY-SA 4.0","body":"If you step through your code with the debugger I think you&#39;ll find the problem pretty quickly. Without seeing what the <code>dice</code> class is it isn&#39;t possible to answer."},{"owner":{"reputation":343407,"user_id":104891,"user_type":"registered","profile_image":"https://www.gravatar.com/avatar/0ff652685122f4500dd4f3c21fb32da2?s=128&d=identicon&r=PG","display_name":"CrazyCoder","link":"https://stackoverflow.com/users/104891/crazycoder"},"edited":false,"score":1,"creation_date":1614379453,"post_id":66393613,"comment_id":117377218,"content_license":"CC BY-SA 4.0","body":"Reinstall the IDE from <a href=\"https://www.jetbrains.com/idea/download/index.html\" rel=\"nofollow noreferrer\">jetbrains.com/idea/download/index.html</a>. Perform the steps from <a href=\"https://intellij-support.jetbrains.com/hc/en-us/articles/360007568559\" rel=\"nofollow noreferrer\">intellij-support.jetbrains.com/hc/en-us/articles/36000756855&zwnj;&#8203;9</a>."},{"owner":{"reputation":1806,"user_id":4459069,"user_type":"registered","accept_rate":100,"profile_image":"https://i.stack.imgur.com/MO6cm.jpg?s=128&g=1","display_name":"sleepToken","link":"https://stackoverflow.com/users/4459069/sleeptoken"},"edited":false,"score":2,"creation_date":1614379358,"post_id":66393654,"comment_id":117377195,"content_license":"CC BY-SA 4.0","body":"Also, you might want to try <code>System.out.print()</code> instead of <code>System.out.println()</code> in your squares() method."},{"owner":{"reputation":1806,"user_id":4459069,"user_type":"registered","accept_rate":100,"profile_image":"https://i.stack.imgur.com/MO6cm.jpg?s=128&g=1","display_name":"sleepToken","link":"https://stackoverflow.com/users/4459069/sleeptoken"},"edited":false,"score":0,"creation_date":1614379172,"post_id":66393654,"comment_id":117377148,"content_license":"CC BY-SA 4.0","body":"Are you confusing newline <code>&quot;\\n&quot;</code> with tab <code>&quot;\\t&quot;</code>?"},{"owner":{"reputation":343407,"user_id":104891,"user_type":"registered","profile_image":"https://www.gravatar.com/avatar/0ff652685122f4500dd4f3c21fb32da2?s=128&d=identicon&r=PG","display_name":"CrazyCoder","link":"https://stackoverflow.com/users/104891/crazycoder"},"edited":false,"score":1,"creation_date":1614379131,"post_id":66393613,"comment_id":117377136,"content_license":"CC BY-SA 4.0","body":"Make sure Gradle plug-in is enabled: <a href=\"https://www.jetbrains.com/help/idea/managing-plugins.html\" rel=\"nofollow noreferrer\">jetbrains.com/help/idea/managing-plugins.html</a>."},{"owner":{"reputation":14955,"user_id":6478047,"user_type":"registered","accept_rate":76,"profile_image":"https://i.stack.imgur.com/Rd7gY.jpg?s=128&g=1","display_name":"Manohar Reddy","link":"https://stackoverflow.com/users/6478047/manohar-reddy"},"edited":false,"score":3,"creation_date":1614161061,"post_id":66346971,"comment_id":117298652,"content_license":"CC BY-SA 4.0","body":"looks like it was a mistake , <a href=\"https://issuetracker.google.com/issues/180705308\" rel=\"nofollow noreferrer\">issuetracker.google.com/issues/180705308</a>"},{"owner":{"reputation":621707,"user_id":139985,"user_type":"registered","accept_rate":69,"profile_image":"https://www.gravatar.com/avatar/147c5a9cc1feec049c50da791ac7d144?s=128&d=identicon&r=PG","display_name":"Stephen C","link":"https://stackoverflow.com/users/139985/stephen-c"},"edited":false,"score":0,"creation_date":1614161019,"post_id":66346971,"comment_id":117298636,"content_license":"CC BY-SA 4.0","body":"Actually, the <code>Deprecated</code> annotation has <code>retention=RUNTIME</code> (in Oracle Java) so if <code>Deprecated</code> is really deprecated, then we should be able to see something by looking at its &quot;.class&quot; file in the S prerelease binaries  Someone care to try that?"},{"owner":{"reputation":621707,"user_id":139985,"user_type":"registered","accept_rate":69,"profile_image":"https://www.gravatar.com/avatar/147c5a9cc1feec049c50da791ac7d144?s=128&d=identicon&r=PG","display_name":"Stephen C","link":"https://stackoverflow.com/users/139985/stephen-c"},"edited":false,"score":0,"creation_date":1614160749,"post_id":66346971,"comment_id":117298520,"content_license":"CC BY-SA 4.0","body":"Well yes.  But the point that it is shown as added AND deprecated in the same release is hinting that there is something weird going on.  Why would they do that?  This implies to me that there is the problem in the javadoc rendering logic.  But ... hey ... when we get to see the actual source code, we can see what is actually going on."},{"owner":{"reputation":545,"user_id":15055605,"user_type":"registered","profile_image":"https://i.stack.imgur.com/lv3Eu.png?s=128&g=1","display_name":"YaMiN","link":"https://stackoverflow.com/users/15055605/yamin"},"reply_to_user":{"reputation":621707,"user_id":139985,"user_type":"registered","accept_rate":69,"profile_image":"https://www.gravatar.com/avatar/147c5a9cc1feec049c50da791ac7d144?s=128&d=identicon&r=PG","display_name":"Stephen C","link":"https://stackoverflow.com/users/139985/stephen-c"},"edited":false,"score":0,"creation_date":1614159350,"post_id":66346971,"comment_id":117297844,"content_license":"CC BY-SA 4.0","body":"@StephenC deprecation of RepetitiveTest is not a rendering bug, it is indeed deprecated and they&#39;re suggested a replacement which is Android Testing Support Library."},{"owner":{"reputation":545,"user_id":15055605,"user_type":"registered","profile_image":"https://i.stack.imgur.com/lv3Eu.png?s=128&g=1","display_name":"YaMiN","link":"https://stackoverflow.com/users/15055605/yamin"},"reply_to_user":{"reputation":621707,"user_id":139985,"user_type":"registered","accept_rate":69,"profile_image":"https://www.gravatar.com/avatar/147c5a9cc1feec049c50da791ac7d144?s=128&d=identicon&r=PG","display_name":"Stephen C","link":"https://stackoverflow.com/users/139985/stephen-c"},"edited":false,"score":0,"creation_date":1614159227,"post_id":66346971,"comment_id":117297782,"content_license":"CC BY-SA 4.0","body":"@StephenC You&#39;re right. it is present in the source. <a href=\"https://imgur.com/a/8pQQmYU\" rel=\"nofollow noreferrer\">imgur.com/a/8pQQmYU</a> but still according to same javadoc it is deprecated so what&#39;s the replacement?"},{"owner":{"reputation":32673,"user_id":150978,"user_type":"registered","accept_rate":78,"profile_image":"https://www.gravatar.com/avatar/feadc214792e2581c3c750140e3eb2c7?s=128&d=identicon&r=PG","display_name":"Robert","link":"https://stackoverflow.com/users/150978/robert"},"edited":false,"score":0,"creation_date":1614158973,"post_id":66346971,"comment_id":117297653,"content_license":"CC BY-SA 4.0","body":"May be Google wants us to switch to <code>kotlin.Deprecated</code> (which requires to have a message)?"},{"owner":{"reputation":621707,"user_id":139985,"user_type":"registered","accept_rate":69,"profile_image":"https://www.gravatar.com/avatar/147c5a9cc1feec049c50da791ac7d144?s=128&d=identicon&r=PG","display_name":"Stephen C","link":"https://stackoverflow.com/users/139985/stephen-c"},"edited":false,"score":0,"creation_date":1614158591,"post_id":66346971,"comment_id":117297484,"content_license":"CC BY-SA 4.0","body":"And as further evidence of a possible javadoc rendering bug, look at <a href=\"https://developer.android.com/reference/android/test/RepetitiveTest\" rel=\"nofollow noreferrer\">developer.android.com/reference/android/test/RepetitiveTest</a>.  Added in S and deprecated in S.  Makes no sense ...."},{"owner":{"reputation":621707,"user_id":139985,"user_type":"registered","accept_rate":69,"profile_image":"https://www.gravatar.com/avatar/147c5a9cc1feec049c50da791ac7d144?s=128&d=identicon&r=PG","display_name":"Stephen C","link":"https://stackoverflow.com/users/139985/stephen-c"},"edited":false,"score":0,"creation_date":1614158407,"post_id":66346971,"comment_id":117297416,"content_license":"CC BY-SA 4.0","body":"According to the javadoc, the class is in <code>java.lang</code>, not <code>java.lang.annotation</code>"}],"has_more":false,"quota_max":300,"quota_remaining":199}}
//       // let answersContent = {data: {"items":[{"owner":{"reputation":8343,"user_id":2148953,"user_type":"registered","accept_rate":96,"profile_image":"https://i.stack.imgur.com/FeyHn.png?s=128&g=1","display_name":"aran","link":"https://stackoverflow.com/users/2148953/aran"},"is_accepted":true,"score":9,"last_activity_date":1614428197,"last_edit_date":1614428197,"creation_date":1613964294,"answer_id":66309668,"question_id":66309543,"content_license":"CC BY-SA 4.0","body":"<p>I love your class name. Sincerely</p>\n<p>In order to really &quot;return&quot; it, you could implement something like these examples.</p>\n<hr />\n<h2><strong><code>Arrays</code></strong></h2>\n<p><strong>Double assignation at each iteration</strong></p>\n<pre><code>public String getZippppppppppppppppppppppppp(String a, String s)  //a -&quot;ABC&quot; s -&quot;123&quot;\n{    \n   if (s.length()!=a.length())\n      return &quot;&quot;;\n   char[] zip=new char[s.length()*2];      \n   for (int i=0; i&lt;s.length(); i++) \n   {\n      zip[i*2] = a.charAt(i);   \n      zip[(i*2)+1] = s.charAt(i);  \n   }  \n   return new String(zip);  /* &quot;A1B2C3&quot; */\n}\n</code></pre>\n<p>Loop over the length of any of the Strings and insert each element in order. During the iterations, this are the assigned values:</p>\n<pre><code>             i = 0              i = 1             i = 2\n      --------------------------------------------------------\n            zip[0] = A        zip[2] = B         zip[4] = C\n            zip[1] = 1        zip[3] = 2         zip[5] = 3\n  \n</code></pre>\n<p><em>Horrendous paint:</em></p>\n<p><a href=\"https://i.stack.imgur.com/bQmHg.png\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/bQmHg.png\" alt=\"enter image description here\" /></a></p>\n<p>As a result, we got:</p>\n<p><strong><code>zip = ['A','1','B','2','C','3']</code></strong> |||\n<strong><code>new String(zip) = &quot;A1B2C3&quot;</code></strong></p>\n<p><em>Note: If you don't love arrays, you have no hearth.</em></p>\n<p><strong>Single assignation at each iteration</strong></p>\n<p>This uses another approach, totally useless when you can do above's logic, but just for fun.</p>\n<pre><code>static String getZipppppppppppppppppppppUsingCharAtThanksElliot(String a, String s)  \n{                                                                 //a -&quot;ABC&quot; s -&quot;123&quot;\n  if (a.length()!=s.length()) \n      return &quot;&quot;;\n  char[] zip = new char[s.length()*2];\n  int c=0;\n  boolean even = false;\n  for(int i =0; i &lt; (s.length()*2); i++) \n  {\n     even =!even;\n     if (even) \n        zip[i] = a.charAt(c); \n     else \n     {      \n        zip[i] = s.charAt(c);\n        c++; \n     }   \n   }\n   \n   return new String(zip);  //--&gt; &quot;A1B2C3&quot;\n}\n</code></pre>\n<hr />\n<h2>Using <a href=\"https://docs.oracle.com/javase/7/docs/api/java/lang/String.html#subSequence(int,%20int)\" rel=\"nofollow noreferrer\"><code>String#subString</code></a>:</h2>\n<pre><code>public String getZippppppppppppppppppppppppp(String a, String s)  //a -&quot;ABC&quot; s -&quot;123&quot;\n{\n    if (a.length()!=s.length()) \n        return &quot;&quot;;\n    String line=&quot;&quot;;\n    for(int i = 0; i &lt; s.length(); i++)\n        line += ( a.substring(i*1, (i*1)+1) + s.substring(i*1, (i*1)+1) );\n\n    return line;  //--&gt; &quot;A1B2C3&quot;\n}\n</code></pre>\n<p><em>Probably the worst performant approach.</em></p>\n<hr />\n<h2>Using <a href=\"https://docs.oracle.com/javase/7/docs/api/java/lang/String.html#charAt(int)\" rel=\"nofollow noreferrer\"><code>String#charAt</code></a></h2>\n<p>Note that <code>charAt()</code>, correctly pointed out on <strong><a href=\"https://stackoverflow.com/users/2970947/elliott-frisch\">Elliot</a></strong>'s answer, will not work with this logic;  it will give you a numeric text, as result of adding their respective unicode values. It won't append the characters.</p>\n<p>Alternatives to work with <code>charAt()</code> would be using the <strong>empty string workaround</strong>, or creating a <code>char[]</code> as in the second boring example.</p>\n<pre><code>public String getZipppppppppppppppppppppUsingCharAtThanksElliot(String a, String s)  \n{                                                                 //a -&quot;ABC&quot; s -&quot;123&quot;\n    if (a.length()!=s.length()) \n        return &quot;&quot;;\n    String line=&quot;&quot;;\n    for(int i = 0; i &lt; s.length(); i++)\n        line +=  a.charAt(i) + &quot;&quot; + s.charAt(i) ; //note the empty string\n\n    return line;  //--&gt; &quot;A1B2C3&quot;\n}\n</code></pre>\n<hr />\n<hr />\n<h2><strong><code>Zip'em all</code></strong> --- Multiple strings</h2>\n<p><strong>Multi assignation at each iteration - <em>Holger style</em></strong></p>\n<p><em>Motivated by Holger's comments</em></p>\n<p>This will work regardless of the number of strings to zip, from <strong>2 to n</strong>.*</p>\n<p>So it's also the replacement of the first method, as you can either call  <code>getStringsZipped(&quot;ABC,&quot;123&quot;)</code> or <code>getStringsZipped(yourArray)</code></p>\n<pre><code>public String getStringsZipped(String ... mix) \n{    \n   if (!goodMix(mix))\n      return &quot;woloolooO&quot;;           //you are a red monk now\n\n   char[] zip = new char[mix[0].length()*mix.length];    \n   for (int i=0, j=0; i&lt;mix[0].length(); i++) \n      for (String s : mix)\n          zip[j++] = s.charAt(i);\n\n   return new String(zip);  \n}\n\nboolean goodMix(String ... mix)\n{\n    if (mix.length&lt;2) \n      return false;              \n    for (int i=1; i&lt;mix.length; i++)\n      if (mix[i].length()!=mix[0].length())\n         return false;        \n    return true;\n}\n</code></pre>\n<hr />\n<pre><code> String[] mix =new String[] { &quot;AAA&quot;,&quot;123&quot;,&quot;BBB&quot;,&quot;456&quot;,&quot;CCC&quot;,&quot;789&quot;};\n System.out.println(getStringsZipped(mix));               // &quot;A1B4C7A2B5C8A3B6C9&quot;\n\n System.out.println(getStringsZipped(&quot;HLE&quot;,&quot;OGR&quot;));\n System.out.println(getStringsZipped(&quot;IT S&quot;,&quot;SHBS&quot;,&quot; EO &quot;));\n</code></pre>\n<p><em>I'm not making a paint of this thou</em></p>\n"},{"owner":{"reputation":16677,"user_id":13942448,"user_type":"registered","profile_image":"https://i.stack.imgur.com/jxgTU.png?s=128&g=1","display_name":"jccampanero","link":"https://stackoverflow.com/users/13942448/jccampanero"},"is_accepted":false,"score":0,"last_activity_date":1614423747,"last_edit_date":1614423747,"creation_date":1614382519,"answer_id":66394092,"question_id":66393805,"content_license":"CC BY-SA 4.0","body":"<p>I think you have several problems in your code.</p>\n<p>First, as you can see in the <code>getBeansWithAnnotation</code> method <a href=\"https://docs.spring.io/spring-framework/docs/5.0.8.RELEASE/javadoc-api/org/springframework/beans/factory/ListableBeanFactory.html#getBeansWithAnnotation-java.lang.Class-\" rel=\"nofollow noreferrer\">documentation</a>, it will only detect <strong>class</strong> level annotations:</p>\n<blockquote>\n<p>Find all beans whose Class has the supplied Annotation type, returning a Map of bean names with corresponding bean instances.</p>\n</blockquote>\n<p>But, you are trying to apply them to a class in which only fields has been annotated, and with an annotation defined and only suitable for field level - as per the <code>@Target(ElementType.FIELD)</code> - annotation.</p>\n<p>You should create a new annotation suitable to be applied to a type, <code>@Target(ElementType.TYPE)</code>, and apply the class you need to be identified by Spring with this new annotation.</p>\n<p>In addition, that class, <code>ApplicationProperties</code> in your example, should annotated with something that allows Spring to find it. You can use, for instance, <code>@Component</code>, <code>@Service</code>, etcetera, or you can define ...) or defined <code>ApplicationProperties</code> as a <code>@Bean</code> somewhere in your application context: <code>getBeansWithAnnotation</code> will only provide you information about Spring <strong>beans</strong>.</p>\n<p>Finally, Spring provides a feature rich property based configuration system out of the box based on the <code>PropertySource</code> abstraction and related stuff. Please, review the <a href=\"https://docs.spring.io/spring-framework/docs/current/reference/html/core.html#spring-core\" rel=\"nofollow noreferrer\">reference guide</a>, it is plenty of information regarding this topic.</p>\n"},{"owner":{"reputation":1611,"user_id":13736952,"user_type":"registered","profile_image":"https://i.stack.imgur.com/wwa0A.png?s=128&g=1","display_name":"M-Chen-3","link":"https://stackoverflow.com/users/13736952/m-chen-3"},"is_accepted":false,"score":0,"last_activity_date":1614388678,"last_edit_date":1614388678,"creation_date":1614380196,"answer_id":66393791,"question_id":66393654,"content_license":"CC BY-SA 4.0","body":"<p>There are a couple of problems here.</p>\n<ol>\n<li><p>As others have pointed out, <code>\\n</code> creates a new line,<br />\nlike so. <code>\\t</code> on the other hand, creates an indent,<code>      </code> like so. For your purposes, <code>\\t</code> is what you want.</p>\n</li>\n<li><p>In your <code>squares</code> function, you only print two <code>***</code>s. Instead, print 3.</p>\n</li>\n<li><p>Since <code>squares</code> already prints one line, you only need a single for loop going up to 2. The conventional way to do this is <code>int i = 0; i &lt; 2</code>.</p>\n</li>\n</ol>\n<p>Below is the full corrected code (I fixed the indentation, rebracketed, and added a <code>main</code> method):</p>\n<pre class=\"lang-java prettyprint-override\"><code>public class ASCII_Art\n{   \n    public static void squares(){\n        System.out.println(&quot;***\\t***\\t***&quot;);\n    }\n\n    public static void main(String[] args) {\n        for (int i = 0; i &lt; 2; i++) {\n            squares();\n        }\n    }\n}\n</code></pre>\n<p>Alternatively, since your <code>squares</code> method doesn't actually provide much value, you could just do this instead:</p>\n<pre class=\"lang-java prettyprint-override\"><code>public class ASCII_Art\n{   \n    public static void main(String[] args) {\n        for (int i = 0; i &lt; 2; i++) {\n            System.out.println(&quot;***\\t***\\t***&quot;);\n        }\n    }\n}\n</code></pre>\n<p>If you want to customize your ASCII art further, you could make a function taking 3 parameters: one for number of <code>*</code>s, one for number of asterisk blocks in one line, and one for number of lines. I'll let you figure that out yourself...</p>\n"},{"owner":{"reputation":37365,"user_id":768644,"user_type":"registered","profile_image":"https://www.gravatar.com/avatar/b13bedc5215730fbce5edff6c130988a?s=128&d=identicon&r=PG","display_name":"rzwitserloot","link":"https://stackoverflow.com/users/768644/rzwitserloot"},"is_accepted":true,"score":1,"last_activity_date":1614383572,"creation_date":1614383572,"answer_id":66394210,"question_id":66393780,"content_license":"CC BY-SA 4.0","body":"<p>What you want is fundamentally not possible. A <code>java.io.File</code> object represents, quite literally, a <strong>file</strong> and is <em>incapable</em> of representing anything else. It cannot represent 'a sack of bytes', or 'an entry in a jar'. And yet that's what you have here (an entry in a jar). The File API is aware of this and doesn't let you make a File object based on a URL, as that usually is impossible.</p>\n<p>On the other hand, resources are loaded by the classloader. Out of the box, that means it can load either files or entries in jar files, and if you have custom classloaders, sky is the limit: load from the web, load from a database, generate on the fly - whatever you want.</p>\n<p>The fix is to <strong>not use file</strong> - what you have just isn't one, so don't try to represent it with one. Fortunately, all non-idiotic APIs have solutions for this; there will be a method that takes an <code>InputStream</code> or <code>URL</code> in addition to whatever you have that needs a <code>File</code>. If your API doesn't offer such a thing, find a better library. But, most likely, it does.</p>\n<p>Bad idea:</p>\n<pre><code>FileInputStream fis = new FileInputStream(&quot;res/sheet.xlsx&quot;);\nsomeApi.load(fis);\n</code></pre>\n<p>good idea:</p>\n<pre><code>try (InputStream in = Main.class.getResourceAsStream(&quot;/res/sheet.xlsx&quot;)) {\n    someApi.load(in);\n}\n</code></pre>\n"},{"owner":{"reputation":29502,"user_id":1366871,"user_type":"registered","accept_rate":100,"profile_image":"https://www.gravatar.com/avatar/b3ec9d9128a25ba6eae8a1d42c2eb04a?s=128&d=identicon&r=PG","display_name":"dreamcrash","link":"https://stackoverflow.com/users/1366871/dreamcrash"},"is_accepted":true,"score":1,"last_activity_date":1614382437,"last_edit_date":1614382437,"creation_date":1614380864,"answer_id":66393879,"question_id":66393614,"content_license":"CC BY-SA 4.0","body":"<blockquote>\n<p>I tried searching for it but want to know the reasoning behind the\ncorrect answer.</p>\n</blockquote>\n<p>From <a href=\"https://docs.oracle.com/javase/tutorial/java/IandI/super.html\" rel=\"nofollow noreferrer\">source</a> one can read:</p>\n<blockquote>\n<p>Note: If a constructor does not explicitly invoke a superclass\nconstructor, the Java compiler automatically inserts a call to the\nno-argument constructor of the superclass. <strong>If the super class does not\nhave a no-argument constructor, you will get a compile-time error.</strong>\nObject does have such a constructor, so if Object is the only\nsuperclass, there is no problem.</p>\n</blockquote>\n<p>Let us go through each option one by one:</p>\n<p>1- <code>B() {}</code> No, because class <code>A</code> does not have no default constructor; <br>\n2- <code>B(int y){ j = y; }</code>, No for the same reason a 1); <br>\n3- <code>B(int y) { super(y*2); j=y; }</code>. Valid, this one explicitly invokes <code>super</code> with a valid constructor; <br>\n4- <code>B(int y) { i=y; j=y*2; }</code> No, for the same reason as 1) and 2); <br>\n5- <code>B(int z) { this(z,z); }.</code> Valid, this one calls the constructor : <br></p>\n<pre><code> public B(int x, int y){\n        super(x);\n        this.j = y;\n    }\n</code></pre>\n<p>which explicitly invokes <code>super</code> with a valid constructor.</p>\n<p>If class A was instead :</p>\n<pre><code>class A{\n    int i;\n    public A(){}\n    public A(int x){this.i = x;}\n}\n</code></pre>\n<p>because now class A has explicitly the default constructor all options would be valid.</p>\n"},{"owner":{"reputation":18,"user_id":15240292,"user_type":"registered","profile_image":"https://www.gravatar.com/avatar/bf5047b5ed47473a9288a06f381efb30?s=128&d=identicon&r=PG&f=1","display_name":"RW77","link":"https://stackoverflow.com/users/15240292/rw77"},"is_accepted":false,"score":0,"last_activity_date":1614381032,"creation_date":1614381032,"answer_id":66393900,"question_id":66393654,"content_license":"CC BY-SA 4.0","body":"<p>So basically the problem here is that your square method prints out three asterisks and then goes to a new line. You then can't go back to the previous line, which is why the first square looks good, but then the others look out of place. If you look at the output, the first square is being printed. You then print the white-spaces and then another square. But this second square does not start on the first line. It starts on the second, so what ends up happening is the first three asterisks are printed, and then \\n tells it to go to a new line, and then the other three asterisks are printed which is why they look separated. Like other people have suggested, use \\t, not \\n.</p>\n"},{"owner":{"reputation":371,"user_id":14766808,"user_type":"registered","profile_image":"https://i.stack.imgur.com/2po2M.jpg?s=128&g=1","display_name":"Dren","link":"https://stackoverflow.com/users/14766808/dren"},"is_accepted":false,"score":0,"last_activity_date":1614380058,"creation_date":1614380058,"answer_id":66393772,"question_id":66393689,"content_license":"CC BY-SA 4.0","body":"<p>If you want to return 6 random numbers from the method <code>Slides()</code> you could use</p>\n<pre><code>final int[] dicesRandom = new Random().ints(1, 6).distinct().toArray();\n</code></pre>\n<p>Implementing in your method</p>\n<pre><code>public int [] Sides()\n    {\n        String file = &quot;yahtzeeConfig.txt&quot;;\n        \n         final int[] dicesRandom = new Random().ints(1, 6).distinct().toArray();\n        \n       \n        return dicesRandom;\n    }  \n</code></pre>\n<p>And in the main class you dont need to get through the for loop just call this method and it will generate 6 numbers for you</p>\n"},{"owner":{"reputation":621707,"user_id":139985,"user_type":"registered","accept_rate":69,"profile_image":"https://www.gravatar.com/avatar/147c5a9cc1feec049c50da791ac7d144?s=128&d=identicon&r=PG","display_name":"Stephen C","link":"https://stackoverflow.com/users/139985/stephen-c"},"is_accepted":true,"score":62,"last_activity_date":1614163296,"last_edit_date":1614163296,"creation_date":1614162431,"answer_id":66348974,"question_id":66346971,"content_license":"CC BY-SA 4.0","body":"<p>It is a documentation bug.</p>\n<p>The <code>Deprecated</code> annotation is not really deprecated.</p>\n<p>Apparently what happened is that the source code for <code>Deprecated</code> contained this in its javadoc comments:</p>\n<pre><code> * @apiNote\n * It is strongly recommended that the reason for deprecating a program element\n * be explained in the documentation, using the {@code @deprecated}\n * javadoc tag. \n</code></pre>\n<p>Apparently, the <code>{@code @deprecated}</code> was interpreted as an <code>@deprecated</code> javadoc tag by the <a href=\"https://android.googlesource.com/platform/tools/metalava/\" rel=\"noreferrer\"><code>metalava</code></a> tool.  This caused <code>metalava</code> to inject the &quot;missing&quot; <code>@Deprecated</code> annotations into the &quot;.class&quot; files in the Android JAR file.  Presumably, the injected annotation was then incorporated into the generated javadocs on the website.</p>\n<p>Kudos to <a href=\"https://stackoverflow.com/users/6478047/manohar-reddy\">Manohar Reddy</a> for finding the <a href=\"https://issuetracker.google.com/issues/180705308\" rel=\"noreferrer\">bug</a> in the issue tracker.</p>\n<p>You can find the fix that they made <a href=\"https://android-review.googlesource.com/c/platform/libcore/+/1601554/1/ojluni/src/main/java/java/lang/Deprecated.java#b59\" rel=\"noreferrer\">here</a>.</p>\n<hr />\n<p>For what it is worth, <code>java.lang.Deprecated</code> is a class that originates in the Oracle / OpenJDK Java (i.e. standard Java) class libraries.  Android <em>wouldn't</em> (deliberately) deprecate it.  That would create yet another Java &lt;-&gt; Android portability hurdle.</p>\n"},{"owner":{"reputation":61036,"user_id":183406,"user_type":"registered","accept_rate":74,"profile_image":"https://www.gravatar.com/avatar/ca03242df77ec2d8f70f2cea0d6209be?s=128&d=identicon&r=PG","display_name":"meriton","link":"https://stackoverflow.com/users/183406/meriton"},"is_accepted":true,"score":8,"last_activity_date":1614128433,"last_edit_date":1614128433,"creation_date":1614128049,"answer_id":66343170,"question_id":66342959,"content_license":"CC BY-SA 4.0","body":"<p>While reserved words may not occur in Java source code, they are permitted in compiled Java code. Some code obfuscation tools can make use of this to make decompiling harder. For instance, ProGuard provides the following option:</p>\n<blockquote>\n<p><code>-obfuscationdictionary filename</code></p>\n<p>Specifies a text file from which all valid words are used as obfuscated field and method names. By default, short names like 'a', 'b', etc. are used as obfuscated names. With an obfuscation dictionary, you can specify a list of reserved key words, or identifiers with foreign characters, for instance. White space, punctuation characters, duplicate words, and comments after a# sign are ignored. Note that an obfuscation dictionary hardly improves the obfuscation. Decent compilers can automatically replace them, and the effect can fairly simply be undone by obfuscating again with simpler names. The most useful application is specifying strings that are typically already present in class files (such as 'Code'), thus reducing the class file sizes just a little bit more. Only applicable when obfuscating.</p>\n</blockquote>\n<p>So if you feed this a list with Java identifiers (such as <a href=\"https://github.com/facebookarchive/proguard/blob/master/examples/dictionaries/keywords.txt\" rel=\"noreferrer\">this one</a>) you end up with a class file that causes syntax errors if decompiled. Of course, you can simply rename the variables to fix these compilation errors (for instance by using ProGuard yourself before decompiling), so this is only a minor inconvenience.</p>\n"},{"owner":{"reputation":304548,"user_id":131872,"user_type":"registered","accept_rate":100,"profile_image":"https://www.gravatar.com/avatar/a0ced8e21d2a761db718acb6362b9225?s=128&d=identicon&r=PG","display_name":"camickr","link":"https://stackoverflow.com/users/131872/camickr"},"is_accepted":true,"score":1,"last_activity_date":1614094531,"creation_date":1614094531,"answer_id":66336202,"question_id":66328065,"content_license":"CC BY-SA 4.0","body":"<p>I would suggest using &quot;wrapper&quot; panels to achieve you desired layout. Something like:</p>\n<pre><code>JButton scrollLock = new JButton(&quot;...&quot;);\n\nJScrollPane scrollPane = new JScrollPane(...);\nJScrollBar verticalBar = scrollPane.getVerticalScrollBar();\n\nJPanel verticalPanel = new JPanel( new BorderLayout() );\nverticalPanel.add(verticalBar, BorderLayout.CENTER);\nverticalPanel.add(scrollLock, BorderLayout.PAGE_END);\n\nJPanel wrapper = new JPanel( new BorderLayout() );\nwrapper.add(scrollPane, BorderLayout.CENTER);\nwrapper.add(verticalPanel, BorderLayout.LINE_END);\n\nsetContent(wrapper);\n</code></pre>\n"},{"owner":{"reputation":4378,"user_id":5479362,"user_type":"registered","accept_rate":48,"profile_image":"https://www.gravatar.com/avatar/1a1c17810dbd67c4b712afdb081f4ddd?s=128&d=identicon&r=PG&f=1","display_name":"9ilsdx 9rvj 0lo","link":"https://stackoverflow.com/users/5479362/9ilsdx-9rvj-0lo"},"is_accepted":true,"score":5,"last_activity_date":1614091341,"creation_date":1614091341,"answer_id":66335296,"question_id":66335199,"content_license":"CC BY-SA 4.0","body":"<p>Yes, one of the changes was updating Locale Data to Unicode CLDR v33 (see <a href=\"https://www.oracle.com/java/technologies/javase/jdk-11-relnote.html\" rel=\"noreferrer\">https://www.oracle.com/java/technologies/javase/jdk-11-relnote.html</a>)</p>\n<p>This change is relevant for locale-specific formatting, which impacts the usage of the utils like <code>DecimalFormat</code> or <code>SimpleDateFormat</code>.</p>\n<p>So if your code depends on locale-specific formatting, you should double check it after switching to Java 11.</p>\n"},{"owner":{"reputation":98890,"user_id":1059372,"user_type":"registered","accept_rate":97,"profile_image":"https://i.stack.imgur.com/W6OMC.png?s=128&g=1","display_name":"Eugene","link":"https://stackoverflow.com/users/1059372/eugene"},"is_accepted":true,"score":5,"last_activity_date":1614026359,"last_edit_date":1614026359,"creation_date":1614024532,"answer_id":66322705,"question_id":66322345,"content_license":"CC BY-SA 4.0","body":"<p>The first method does not compile because of &quot;capture conversion&quot;, that happens at each declaration. You can read <a href=\"https://stackoverflow.com/questions/3716920/cant-add-value-to-the-java-collection-with-wildcard-generic-type/56934197#56934197\">my other answer about this</a>, or <a href=\"https://stackoverflow.com/questions/63947339/why-is-this-assignment-involving-wildcards-legal-in-java/63962748#63962748\">this one</a>. But to put it simply, you will have two <em>separate</em> types there, which you can see when you compile via:</p>\n<pre><code> javac --debug=verboseResolution=all\n</code></pre>\n<p>And the output will contain:</p>\n<pre><code>.....\nCAP#1 extends Object from capture of ?\nCAP#2 extends Object from capture of ?\n...\n</code></pre>\n<p>which means there are <em>two</em> types that have been capture converted. These types are unrelated to each other, the way you have it.</p>\n<p>This on the other hand:</p>\n<pre><code>public static &lt;T&gt; void nothing(Collection&lt;T&gt; c){\n\n}\n</code></pre>\n<p>is called <em>wildcard capture</em> method (it &quot;captures&quot; a wildcard) and is documented in <a href=\"https://docs.oracle.com/javase/tutorial/java/generics/capture.html\" rel=\"nofollow noreferrer\">official tutorial</a> on why it works and how; thus you have no problem with that.</p>\n<hr />\n<p>But the main problem here is that you can't assign anything (other than <code>null</code>) to a wildcard. So in your <code>compute</code> example, the first argument is going to be inferred to a <code>?</code> and you can't assign anything to that.</p>\n"},{"owner":{"reputation":118219,"user_id":3788176,"user_type":"registered","accept_rate":54,"profile_image":"https://www.gravatar.com/avatar/9c18d321d8948803c05643d87b003dc2?s=128&d=identicon&r=PG&f=1","display_name":"Andy Turner","link":"https://stackoverflow.com/users/3788176/andy-turner"},"is_accepted":false,"score":5,"last_activity_date":1614025900,"last_edit_date":1614025900,"creation_date":1614024922,"answer_id":66322776,"question_id":66322345,"content_license":"CC BY-SA 4.0","body":"<pre><code>public static Map&lt;?, Long&gt; manualMap(Collection&lt;?&gt; c){\n    Map&lt;?, Long&gt; map = new HashMap&lt;&gt;();\n    c.forEach(e -&gt; map.compute(e, (k, v) -&gt; (v == null) ? 1 : v + 1));\n    return map;\n}\n</code></pre>\n<p>Here, you have three wildcards: the one on the parameter, the one on the map variable, and the one on the return value. (The return value one isn't super relevant).</p>\n<p>You are trying to pass elements from the collection (of one wildcard type) into a method of the map (of another wildcard type).</p>\n<p>The compiler doesn't know that those two are &quot;meant to be&quot; the same, so it doesn't accept a &quot;collection&quot; wildcard where it needs a &quot;map&quot; wildcard.</p>\n<p>You can indicate that they are the same type via a type variable:</p>\n<pre><code>public static &lt;T&gt; Map&lt;?, Long&gt; manualMap(Collection&lt;T&gt; c){\n    Map&lt;T, Long&gt; map = new HashMap&lt;&gt;();\n    c.forEach(e -&gt; map.compute(e, (k, v) -&gt; (v == null) ? 1 : v + 1));\n    return map;\n}\n</code></pre>\n<p>Here, T is a type that you don't know; but you know it's the same unknown type in both cases.</p>\n<p>Or you can just declare it in a way that doesn't need two wildcards:</p>\n<pre><code>return c.stream().collect(groupingBy(a -&gt; a, counting()));\n</code></pre>\n"},{"owner":{"reputation":67253,"user_id":2541560,"user_type":"registered","profile_image":"https://i.stack.imgur.com/7H9TF.png?s=128&g=1","display_name":"Kayaman","link":"https://stackoverflow.com/users/2541560/kayaman"},"is_accepted":false,"score":3,"last_activity_date":1614024558,"creation_date":1614024558,"answer_id":66322712,"question_id":66322345,"content_license":"CC BY-SA 4.0","body":"<p>The problem is that your method is accepting a collection of type &quot;I don't care&quot;, but you're also creating a map with keys of &quot;I don't care&quot;. That does not mean the types you do not care about are the same types. For that you need to actually bind the type, by using a type variable e.g.</p>\n<pre><code>public static &lt;T&gt; Map&lt;T, Long&gt; manualMap(Collection&lt;T&gt; c){\n    Map&lt;T, Long&gt; map = new HashMap&lt;&gt;();\n    c.forEach(e -&gt; map.compute(e, (k, v) -&gt; (v == null) ? 1 : v + 1));\n    return map;\n}\n</code></pre>\n<p>The method will still accept any types of collections, but it cares enough to keep track of the type and there's no wildcards or warnings anywhere, yay!</p>\n"},{"owner":{"reputation":2093,"user_id":15102459,"user_type":"registered","profile_image":"https://i.stack.imgur.com/ccQ9P.png?s=128&g=1","display_name":"Horse","link":"https://stackoverflow.com/users/15102459/horse"},"is_accepted":false,"score":2,"last_activity_date":1614017726,"last_edit_date":1614017726,"creation_date":1613965646,"answer_id":66309796,"question_id":66309543,"content_license":"CC BY-SA 4.0","body":"<h2>Do not use <code>charAt</code>, <code>substring</code> on Strings</h2>\n<ol>\n<li>Using <code>charAt</code> and <code>substring</code> assumes that characters in the <code>String</code> are in Basic Multilingual Plane (BMP)</li>\n<li>For any characters in Supplementary Plane(SP), these assumptions will give invalid characters</li>\n</ol>\n<h2>Use codepoint</h2>\n<ol>\n<li>Code points should become the default and any processing with <code>char</code> should be deprecated</li>\n<li>Use Guava <code>Streams.zip</code> (this is beta for very long years and we can depend)</li>\n</ol>\n<pre class=\"lang-java prettyprint-override\"><code>import com.google.common.collect.Streams;\nimport java.util.stream.Collectors;\n\nclass Zippppp {\n    private final String zipped;\n    public Zippppp(String a, String b) {\n        zipped = Streams.zip(a.codePoints().boxed(), b.codePoints()\n            .boxed(), (x, y) -&gt; new String(Character.toChars(x)) + new String(Character.toChars(y)))\n            .collect(Collectors.joining());\n    }\n\n\n    public static void main(String[] args){\n        System.out.println(new Zippppp(&quot;\\uD83D\\uDE00\\uD83D\\uDE00\\uD83D\\uDE00&quot;, &quot;123&quot;).zipped); // 😀1😀2😀3\n        System.out.println(new Zippppp(&quot;ABC&quot;, &quot;12&quot;).zipped); // A1B2\n    }\n}\n</code></pre>\n"},{"owner":{"reputation":98890,"user_id":1059372,"user_type":"registered","accept_rate":97,"profile_image":"https://i.stack.imgur.com/W6OMC.png?s=128&g=1","display_name":"Eugene","link":"https://stackoverflow.com/users/1059372/eugene"},"is_accepted":false,"score":8,"last_activity_date":1614011884,"creation_date":1614011884,"answer_id":66319725,"question_id":66318158,"content_license":"CC BY-SA 4.0","body":"<p>This is covered by the documentation, but not directly, it is implied.</p>\n<blockquote>\n<p>The identity value must be an identity for the accumulator function. <strong>This means that for all t, accumulator.apply(identity, t) is equal to t</strong>.</p>\n</blockquote>\n<p>As soon as <code>identity</code> is modified, like you say, even if in a thread-safe way, the rule above is violated; thus no guarantees of the expected result.</p>\n<p>For the second question the answer is slightly more involved. You do not <em>have</em> to make the <code>identity</code> immutable, as long as no one abuses that (by modifying its internal state). Of course making it <code>immutable</code> helps a lot in that regard.</p>\n"},{"owner":{"reputation":37365,"user_id":768644,"user_type":"registered","profile_image":"https://www.gravatar.com/avatar/b13bedc5215730fbce5edff6c130988a?s=128&d=identicon&r=PG","display_name":"rzwitserloot","link":"https://stackoverflow.com/users/768644/rzwitserloot"},"is_accepted":true,"score":9,"last_activity_date":1614009902,"creation_date":1614009902,"answer_id":66319152,"question_id":66318158,"content_license":"CC BY-SA 4.0","body":"<p>Ordinarily, <code>accumulator</code> is an english word that means: &quot;You are completely hosed if you want parallelism&quot;. It's right there in the word: To accumulate - to gather over time. There is no way to do it right except to start from the beginning, and apply accumulation until you are done.</p>\n<p>But, java gets around this by adding 2 requirements:</p>\n<ol>\n<li>associativity. <code>a X (b X c)</code> must produce the same result as <code>(a X b) X c</code>, where X is the assumulator function.</li>\n<li>identity function. <code>ident X a</code> must be equal to <code>a</code>, where <code>ident</code> is the identity you pass to <code>reduce</code> and X is the accumulator function.</li>\n</ol>\n<p>Let's use as example the function <code>(a, b) -&gt; a + b</code> and as identity <code>0</code>, which fulfills both of these requirements if your intent is to sum a list.</p>\n<p>Java can parallellize this by just summing arbitrary terms and then summing the results of these. <code>[1, 5, 9, 12]</code> can be summed by first lopping the list into two, then handing these 2 sublists to threads to individually sum, and then summing the answers each thread provides. <strong>This implies that java will start accumulation multiple times at arbitrary points in the stream, and will apply identity as part of its accumulation any number of times, at arbitrary points</strong>, and that brings swift problems if your identity object is itself mutable.</p>\n<p>There's basically no way to combine the notion of a mutable <code>identity</code> object and java's <code>reduce</code> function. It is fundamentally not designed to work that way.</p>\n<p>Contrast to the sum example: Instead of modifying a in the <code>(a, b) -&gt; a + b</code> accumulator, neither a nor b are modified; instead, they are combined into a newly created third value, and that's how you should use this method.</p>\n<p>Contrast to <code>foldLeft</code> from certain other languages, which do not require either <code>accumulatorFunction(ident, A)</code> to be equal to A, nor associativity, but then cannot by definition parallellize it, at all. That foldLeft <em>can</em> be used with mutable state. For example, here is an impl of summing using a foldLeft, in pseudocode: (note that <code>new int[1]</code> is used here as mutable integer):</p>\n<pre><code>int sum = stream.foldLeft(new int[1], (int[] a, int b) -&gt; a[0] += b)[0];\n</code></pre>\n<p>This notion (where the LHS of your accumulator function is always the same thing, namely, your identity object, being modified to integrate each value in the stream as you move along it) is <strong>not compatible</strong> with java's reduce, and as far as I can recall, java has no (easy) way to do this kind of thing to a stream.</p>\n<p>Thus: It's worse! 'thread safe' isn't good enough, it needs to be immutable. Once it is immutable, it is trivially thread safe.</p>\n<blockquote>\n<p>is it enough just to make identity object immutable and return a new instance upon each reduce?</p>\n</blockquote>\n<p>That's not just 'good enough', that's more or less the only sane way to use <code>reduce</code>.</p>\n"},{"owner":{"reputation":181612,"user_id":2970947,"user_type":"registered","profile_image":"https://i.stack.imgur.com/HAq55.png?s=128&g=1","display_name":"Elliott Frisch","link":"https://stackoverflow.com/users/2970947/elliott-frisch"},"is_accepted":false,"score":2,"last_activity_date":1613963774,"creation_date":1613963774,"answer_id":66309615,"question_id":66309543,"content_license":"CC BY-SA 4.0","body":"<p>You are currently instantiating <code>Zippppp</code> instances and printing as a side-effect of instantiation. That is not what a constructor is intended for, make a <code>static</code> method and return a <code>String</code>. And use a <code>StringBuilder</code>. Something like,</p>\n<pre><code>public static String Zippppp(String a, String s) {\n    StringBuilder sb = new StringBuilder();\n    if (a != null &amp;&amp; s != null &amp;&amp; a.length() == s.length()) {\n        for (int i = 0; i &lt; a.length(); i++) {\n            sb.append(a.charAt(i)).append(s.charAt(i));\n        }\n    }\n    return sb.toString();\n}\n</code></pre>\n<p>And then to call it</p>\n<pre><code>System.out.println(Zippppp(&quot;ABC&quot;, &quot;123&quot;));\n</code></pre>\n"},{"owner":{"reputation":569,"user_id":11199879,"user_type":"registered","profile_image":"https://www.gravatar.com/avatar/a0a9c56c2190957960c9463c03486df8?s=128&d=identicon&r=PG&f=1","display_name":"Kaplan","link":"https://stackoverflow.com/users/11199879/kaplan"},"is_accepted":false,"score":3,"last_activity_date":1613914715,"last_edit_date":1613914715,"creation_date":1613853737,"answer_id":66296344,"question_id":66283700,"content_license":"CC BY-SA 4.0","body":"<p><em>the 2-step solution with a lambda</em><br />\n(1) convert the <code>Set&lt;Set&lt;Integer&gt;&gt;</code> to a <code>List&lt;Integer[]&gt;</code><br /></p>\n<pre><code>List&lt;Integer[]&gt; arrangedIndexOfCourses = coursesIndex.stream()\n    .map( s -&gt; s.toArray(Integer[]::new) ).collect( toList() );\n</code></pre>\n<p>(2) iterate over the arrays and change the <em>zero-arrays</em> in the traditional way<br /></p>\n<pre><code>for( Integer[] indices: arrangedIndexOfCourses ) {\n  if( indices.length &gt; 0 &amp;&amp; indices[0] == 0 ) {\n    for( int i = 0; i &lt; indices.length - 1; i++ )\n      indices[i] = indices[i + 1];    \n    indices[indices.length - 1] = 0;\n  }\n}\n</code></pre>\n<p><br /><em>a lambda based on Alex's mind blowing solution</em><br />\nmoving the zero-rotating-stuff upstream makes the lambda less <em>trickier</em> and You can work with collections instead of arrays</p>\n<pre><code>List&lt;Integer[]&gt; arrangedIndexOfCourses = coursesIndex.stream()\n    .map( s -&gt; {\n      if( s.stream().findFirst().orElse(-1) == 0 ) {\n        List&lt;Integer&gt; l = new ArrayList&lt;&gt;();\n        l.addAll( s );\n        l.remove( 0 );\n        l.add( 0 );\n        return l.toArray(Integer[]::new);\n      } else\n        return s.toArray(Integer[]::new); } ).collect( toList() );\n</code></pre>\n"},{"owner":{"reputation":11555,"user_id":13279831,"user_type":"registered","profile_image":"https://i.stack.imgur.com/H0dcs.png?s=128&g=1","display_name":"Alex Rudenko","link":"https://stackoverflow.com/users/13279831/alex-rudenko"},"is_accepted":true,"score":4,"last_activity_date":1613767014,"last_edit_date":1613767014,"creation_date":1613766368,"answer_id":66284553,"question_id":66283700,"content_license":"CC BY-SA 4.0","body":"<p>It appears, the main trick in this task is how to implement rotation of the first element if it is 0.</p>\n<p>As mentioned in the comments, not all types of sets maintain order and therefore have a &quot;first&quot; element.  But upon converting a set to stream, even for a <code>HashSet</code> there's a first element in the stream unless it's empty.</p>\n<p>Therefore, the set of integer sets may be converted to a list of integer arrays as follows:</p>\n<ol>\n<li>Take the first element of the stream using <code>limit</code> or <code>findFirst</code></li>\n<li>Compare to 0, if needed put it to the end</li>\n<li>Else keep the stream of the set as is</li>\n</ol>\n<pre class=\"lang-java prettyprint-override\"><code>Set&lt;Set&lt;Integer&gt;&gt; data = Set.of(\n    Collections.emptySet(),\n    new LinkedHashSet&lt;&gt;(Arrays.asList(0, 1, 2, 3)),\n    new LinkedHashSet&lt;&gt;(Arrays.asList(4, 5, 6)),\n    new LinkedHashSet&lt;&gt;(Arrays.asList(10, 0, 100, 1000)),\n    new TreeSet&lt;&gt;(Arrays.asList(25, 0, 1, 16, 4, 9)),\n    new HashSet&lt;&gt;(Arrays.asList(0, 5, 50))\n);\n      \nList&lt;Integer[]&gt; rotatedZeros = data\n    .stream()\n    .map(s -&gt; \n        (s.stream().findFirst().orElse(-1) == 0 // or limit(1).findAny()\n            ? Stream.concat(s.stream().skip(1), Stream.of(0))\n            : s.stream())\n        .toArray(Integer[]::new)\n    )\n    .collect(Collectors.toList());\n\nrotatedZeros.stream().map(Arrays::toString).forEach(System.out::println);\n</code></pre>\n<p>Output:</p>\n<pre><code>[]\n[4, 5, 6]\n[1, 2, 3, 0]\n[10, 0, 100, 1000]\n[1, 4, 9, 16, 25, 0]\n[50, 5, 0]\n</code></pre>\n"},{"owner":{"reputation":98890,"user_id":1059372,"user_type":"registered","accept_rate":97,"profile_image":"https://i.stack.imgur.com/W6OMC.png?s=128&g=1","display_name":"Eugene","link":"https://stackoverflow.com/users/1059372/eugene"},"is_accepted":true,"score":7,"last_activity_date":1613754909,"creation_date":1613754909,"answer_id":66282088,"question_id":66278909,"content_license":"CC BY-SA 4.0","body":"<p>This is compiler &quot;weakness&quot;, at least until <a href=\"http://openjdk.java.net/jeps/302\" rel=\"noreferrer\">this JEP is in place</a>.</p>\n<p>I have already answered almost the same exact question <a href=\"https://stackoverflow.com/questions/50169639/function-and-predicate-parameter-ambiguous/50169759#50169759\">here</a>. There is also another <a href=\"https://stackoverflow.com/questions/21905169/java8-ambiguity-with-lambdas-and-overloaded-methods/21951311#21951311\">answer from JDK core developers too</a>.</p>\n<p>There is also <a href=\"https://stackoverflow.com/questions/47276988/method-reference-is-ambiguous-for-thread-sleep\">yet another question</a> that is very close to yours.</p>\n<p>What matters is that this is known to cause a problem, at times, but has a trivial solution - use a <code>lambda</code>, and thus an <em>explicit</em> type, according to the <code>JLS</code>.</p>\n"},{"owner":{"reputation":62052,"user_id":1064245,"user_type":"registered","accept_rate":82,"profile_image":"https://www.gravatar.com/avatar/9e1ed9c48a989a39ff2a14b1d36c177a?s=128&d=identicon&r=PG&f=1","display_name":"M A","link":"https://stackoverflow.com/users/1064245/m-a"},"is_accepted":false,"score":1,"last_activity_date":1613752643,"last_edit_date":1613752643,"creation_date":1613746906,"answer_id":66279966,"question_id":66278909,"content_license":"CC BY-SA 4.0","body":"<p>My guess is that the compiler is finding two occurrences of <code>toLowerCase</code> in the <code>String</code> class, so it decides to first infer from the second argument, <code>Collectors.counting()</code>, which is resolved to <code>Object</code>. This leads the compiler to throw an error because it can't find any <code>toLowerCase()</code> method accepting an <code>Object</code>.</p>\n<p>If we try to define a method to use it as replacement:</p>\n<pre><code>static String toLowerCase(String s) {\n    return s.toLowerCase();\n}\n</code></pre>\n<p>the following would then work:</p>\n<pre><code>Collectors.groupingBy(Test::toLowerCase, Collectors.counting()); // compiles ok\n</code></pre>\n<p>But if we introduce another overload, the problem appears again:</p>\n<pre><code>static String toLowerCase(String s) {\n    return s.toLowerCase();\n}\n\nstatic String toLowerCase(String s, Locale locale) {\n    return s.toLowerCase(locale);\n}\n\nCollectors.groupingBy(Test::toLowerCase,Collectors.counting()); // fails again\n</code></pre>\n"},{"owner":{"reputation":137000,"user_id":5133585,"user_type":"registered","accept_rate":96,"profile_image":"https://i.stack.imgur.com/dfqcw.png?s=128&g=1","display_name":"Sweeper","link":"https://stackoverflow.com/users/5133585/sweeper"},"is_accepted":true,"score":4,"last_activity_date":1613704360,"last_edit_date":1613704360,"creation_date":1613701920,"answer_id":66270995,"question_id":66270872,"content_license":"CC BY-SA 4.0","body":"<p>Think about what type of array you are instantiating here. In the first case, it is a</p>\n<pre><code>OuterClass&lt;T&gt;.InnerClass[]\n</code></pre>\n<p>Note that this type is a parameterised type (<code>&lt;T&gt;</code>), and <a href=\"https://docs.oracle.com/javase/tutorial/java/generics/restrictions.html#createArrays\" rel=\"nofollow noreferrer\">you are not allowed to create arrays of parameterised types</a>.</p>\n<p>In the second case, since the declaration of <code>InnerClass</code> is parameterised, the name &quot;<code>InnerClass</code>&quot; actually refers to a <a href=\"https://stackoverflow.com/questions/2770321/what-is-a-raw-type-and-why-shouldnt-we-use-it\"><em>raw type</em></a> (because you are not specifying the type arguments), and because it is a raw type, the type of array that you are creating becomes:</p>\n<pre><code>OuterClass.InnerClass[]\n</code></pre>\n<p>Note that <code>OuterClass</code> loses its type parameter too, because you are using a raw type. This is now <em>not</em> a parameterised type, so you are allowed to create such an array.</p>\n"},{"owner":{"reputation":8285,"user_id":990750,"user_type":"registered","accept_rate":50,"profile_image":"https://i.stack.imgur.com/nIvmG.jpg?s=128&g=1","display_name":"Tarik","link":"https://stackoverflow.com/users/990750/tarik"},"is_accepted":false,"score":0,"last_activity_date":1613701441,"creation_date":1613701441,"answer_id":66270929,"question_id":66270872,"content_license":"CC BY-SA 4.0","body":"<p>The following code would work as well:</p>\n<pre><code>public class OuterClass&lt;T&gt;\n{\n    class InnerClass&lt;U&gt;  //changed from T to U\n    {\n       U temp;\n    }\n\n    private InnerClass&lt;T&gt;[] theArray;\n\n    public OuterClass(int size){\n       this.theArray = new InnerClass[size];\n  }\n}\n</code></pre>\n<p>In the first case, T is not recognized as a type parameter in the inner class. In case 2, you have provided a type parameter that you have selected to also be T for the inner class, but in fact has nothing to do with the type parameter of the outer class.</p>\n"}],"has_more":false,"quota_max":300,"quota_remaining":197}}
